import React from 'react'
import './Humidity.css'


const Humidity = (props) => {
    const {weather, dummyData} = props
    return (
        <div className='humidity'>
            {/* <p>Humidity</p> */}
            { weather.main.humidity !== undefined ? (
                <p className='vis-num'>{weather.main.humidity}</p>
            ) : (
                <p className='vis-num'>{dummyData.main.humidity !== undefined ? dummyData.main.humidity : 'N/A'}</p>
            )}
        </div>
    )
}

export default Humidity
